select startdate into @datestart from semesterinfo where startdate < customdate order by startdate desc limit 1;
select weekday(@datestart) into @datedif;
set @datedif = 7- @datedif;
set @cust = customdate;
SET @sql := CONCAT('select DATE_ADD("', @datestart, '", INTERVAL ' , @datedif ,' DAY) into @newdate'); 
